import React from "react";
import { Container } from "react-bootstrap";
import { Link } from "react-router-dom";
import "../css/header.css";

const HeaderLogin = () => {
  return (
    <Container>
      <nav>
        <div className="logo">
          <a href="/">Netflix</a>
        </div>
      </nav>
    </Container>
  );
};

export default HeaderLogin;
